You only need a tablespoon to make an incredible #cake in no-time!

INGREDIENTS
12 tbsp sugar;
12 tbsp vegetable oil;
12 tbsp milk;
12 tbsp all-purpose flour;
1 tsp baking powder;
a pinch of salt;
zest and juice of 1 lemon;
a pinch of vanilla powder;
3 eggs.
METHOD
Using a hand mixer beat the eggs with sugar and vanilla powder until pale and fluffy (for around 3-4 minutes).
Add in milk, lemon juice and vegetable oil, mix to combine.
Whisk flour with baking powder and salt. Add dry ingredients into the liquids and mix until a smooth batter forms.
Transfer into a baking pan (20x20 cm) and bake for 40-45 minutes at 180C/350F.

